Contro:
- non sempre è bio, controllate le etichette, perchè per legge possono vendere il 10% dei prodotti non bio (questo è quello che mi hanno detto quando ho chiesto spiegazione);
- nel ristorante molto spesso il cibo NON è fresco o gli ingredienti sono scadenti, non tutti, inoltre il cibo della gastronomia non si può mangiare lì;
- in cassa, anche se hai una lunga fila dietro a te, le cassiere restano a guardarti, con mani conserte, ma MAI  che imbustino, neanche se stai partorendo lì, o se hai bimbi in braccio o altro, io glielo chiedo lo stesso, tanto per non fare aspettare inutilmente le altre persone dietro e loro lo fanno ma s'infastidicono.
Pro:
-- la naturopata in erboristeria è gentile e capace;
- si può trovare veramente di tutto;
- i prezzi sono leggermente più bassi (ho trovato solo un negozio con prezzi più convenienti se acquisti almeno € 50, allora ti applicano il 5% di sconto sulla spesa o se acquisti almeno € 100 ti applicano il 10%).
